import React from 'react';
import './Adjust.css'
import  Slider from 'nw-react-slider'

const Adjust = (props) => {
    return (
        <div className="adjust-main-container">
            <p style={{textAlign: "center"}}>Adjust</p>
            <Slider  
           value={0}
           min={0}
           max={10}
           ticks
           markers={[{value: 3, label: 'Three'}, {value: 8, label: 'Eight'}]}
            />
        </div>
      );
}

export default Adjust;
